import React from 'react'
import "./Navbar.css"

function Navbar() {
    return (
        <div>
            <img className="nav_logo"
            src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Netflix_2015_logo.svg/250px-Netflix_2015_logo.svg.png"
            alt="Netflix Logo"
            />
        </div>
    )
}

export default Navbar
